		<style>
			body {
				font-family: Arial, sans-serif;
				background-color: #f7f7f7;
				margin: 0;
				padding: 20px;
			}

			h1 {
				text-align: center;
				color: #333;
				margin-bottom: 20px;
			}

			#chatBox {
				width: 100%;
				margin-bottom: 10px;
			}

			input[type="text"],
			button {
				box-sizing: border-box;
				width: 100%;
				padding: 10px;
				font-size: 16px;
				border-radius: 5px;
				border: 1px solid #ccc;
			}

			button {
				display: block;
				margin-bottom: 10px;
				margin-top: 10px;
				padding: 10px;
				font-size: 16px;
				border-radius: 5px;
				background-color: #333;
				color: #fff;
				border: none;
			}

			.message {
				padding: 10px;
				border-radius: 4px;
				margin-bottom: 10px;
				line-height: 1.4;
			}

			.user {
				background-color: #e6f7ff;
				border: 1px solid #91d5ff;
			}

			.assistant {
				background-color: #d9f7be;
				border: 1px solid #b7eb8f;
			}

			.sending-message {
				color: grey;
			}
		</style>
	</head>
